Sensing Murder (New Zeeland version 16:9)

A Bump in the Night

Season 1, Episode 5 Aired: 4/4/2006

In 1980 six year old Alicia O'Reilly was brutally raped and murdered in her own bed, while her sister slept less than a metre away. Her killer has never been found. Psychics Deb Webber and Kelvin Cruickshank try to tune into the spirit of Alicia with the aim of finding new leads.

